            "סילבוס": "הקורס נועד לפתח מיומנויות מתקדמות של הבנה, הנדרשות להתמודדות יעילה עם קריאת חומרים אקדמיים באנגלית. יושם דגש על קריאה וניתוח של טקטסים אקדמיים, העשרת אוצר המלים ותרגול של מבנים דקדוקיים. לצד זאת, תינתן תשומת לב גם לטיפול יכולות הבנת הנשמע והביטוי בעל-פה בשפה.\n תוצאות למידה: בסיום הקורס, הסטודנטיות והסטודנטים יגיעו לרמת שליטה באנגלית המקבילה לרמת B2 ב- ב- EUROPEAN FRAMEWORK OF REFERENCE FOR LANGUAGES, ויהיו מסוגלים:\n 1. לקרוא טקסטים אקדמיים באנגלית בתחומי המדע ולהפיק מהם את הרעיונות העיקריים ואת הפרטים ברמות הבנה שונות - מפורשות ומרומזות.\n 2. להבין טקסטים מושמעים באנגלית בתחומי המדע ולהפיק מהם את הרעיונות העיקריים ואת הפרטם ברמות הבנה שונות - מפורשות ומ רומזות.",
