            "סילבוס": "גישות מתקדמות להערכת הישגים לימודיים במתמטיקה. שימוש במגוון של מקורות ואמצעים, על מנת להעריך מכלול שלם של סוגי ידע ומיומנויות במתמטיקה ברמות שונות של הבנה ובמצבי למידה שונים. יישום שיטות הערכה עדכניות וניתוח התפיסה החינוכית העומדת ביסודן והקשר שלהן לתכנית הלימודים ולמטרות לימוד המתמטיקה. בין היתר תיכללנה השיטות הבאות : הערכה דיאגנוסטית, הערכת ביצוע, הערכה באמצעות תיק עבודות, הערכה של מטלות בסיוע מחשב, הערכה של משימות פתוחות."
