            "סילבוס": "יישום מערכת שלמה המורכבת ממעבד, התקנים פריפריאליים ולוגיקה נוספת על רכיב בודד. שילוב חומרה/תוכנה ותקשורת בין ההתקנים השונים. שיקוליתכן שונים של ארכיטקטורת מיקרו-מעבד מרובה ליבות. בחינת השפעת הפרמטרים השונים על ביצועי המערכת. מימוש אלגוריתם מקבילי, ניתוח ביצועים, זיהוי צווארי בקבוק, ואיזון עומסים. חומרה ותוכנה."
