            "סילבוס": "הציון ייקבע עפ\"י מעקב והערכה במשך הסמסטר ו.או מבחני מיומנות. הרישום לנבחרת מתבצ ע ע\"י המאמן לאחר בחינת רמתו הספורטיבית של המועמד במהלך שלושת השיעורים הראשונים של הסמסטר. סטודנט שיתקבל לאחת הנבחרות או קורסי המתקדמים חייב לבטל מיידית את ריש ומו למקצוע ספורט אחר, אחרתלא ייקלט רישומו. סטודנט אינו רשאי להירשם ליותר מאחד מ מקצועות החינוך הגופני והנבחרות באותו סמסטר. נוכחות חובה בכל השיעורים. להלן פירו ט הנבחרות: אתלטיקה קלה, כדור עף - אולמות וחופים, כדור סל, כדור רגל, טניס, טניס שולחן, ריצות ארוכות, כדור יד, ג'ודו, סייף, שייט, שחמט, קראטה, סלסה - להקה, שחיי ה, כדור מים, להקת מחול, סקווש, ניווט, אופני הרים, באולינג, גלשני מפרש, ו, קארטינג, דיבייט, קיאקים, סנונית, להקת מעודדות."
