            "סילבוס": "סטודיו 3 הינו סטודיו עיצוב תעשייתי במתכונת של הרצאה, וסטודיו בהנחיה קבוצתית ואישית. מטרת הקורס היא להתוות דרכי פעולה, הקניית מתודות יצירתיות, כוונון, ותרגול הצגת משתתפים ודיון קבוצתי. הסטודיו מתניע את פרויקט הגמר של עיצוב תעשייתי ללא תזה, ומלווה את תחילת העבודה על פרויקט הגמר לאורך סמסטר ליצירת נפח מחקר וסקיצות על מנת ליצור קונספט בהיר וברור להמשך הפיתוח. הסטודיו מלווה את תחומי הפיתוח והעיצוב שמתקיימים בתהליך, תוך הקשר להיסטוריה של העיצוב, עיצוב בדגשים של תרחיש, היבט חווית משתמש, טכנולוגיית יצור וטכנולוגיות דיגיטליות. הקורס מתנהל בשיטת סטודיו, בה מחויבים הסטודנטים להביא מידי שבוע נפח עבודה, תוך כדי מצגות קצרות ועדכון בהתקדמות אישית.\n תוצאות למידה: בסי ום הקורס הסטודנט יהיה מסוגל:\n 1. להגיש מצגת מלאה של קונצפט עיצוב כולל אב טיפוס ראשוני. 2. לתכלל פרויקט בחשיבה עיצובית בהיבטיו השונים."
