            "סילבוס": "במסגרת הקורס יחשפו הסטודנטים לשימושים של כלים ושיטות מתמטיות מתקדמות בבעיות בחזית המחקר במדעים מדויקים, הנדסה ומדעי החיים. מטרת הסמינר היא לסייע לסטודנטים בתוכנית הבין-יחידתית למתמטיקה שימושית למצוא מנחה ונושא למחקר, וכן לסייע לסטודנטים בסוף תואר ראשון המתענייניםבתוכנית להיחשף לתחומי המחקר ולמנחים הפוטנציאליים בה.  בהתאם, הסמינר יורכב מהרצאות אורח שיינתנו על ידי חוקרים שונים המשויכים לתוכניתהבין-יחידתית למתמטיקה שימושית ואשר יכולים לשמש כמנחים בתוכנית. בהרצאות יושם דגש על פרוייקטי מחקר רלוונטים במסגרת תואר שני. עבודת סיכום הקורס תתמקד באחת מבעיות המחקר שיוצגו במהלך הקורס. תוצאות למידה: בסיום הקורס הסטודנטיות והסטודנטים יהיו מסוגלים:\n 1. להכיר גישות מ תמטיות המשמשות במדעים מדויקים, הנדסה ומדעי החיים ואת היישום המעשי של גישות אלו.\n 2.  יכירו מגוון פרויקטי מחקר בטכניון בדגש על האספקטים הקשורים בשילוב כלים מתמטיים לחקר תופעות ניסיוניות.\n 3.להכיר שימוש של טכניקות מתמטיות דומות בהקשרים שונים.\n 4. ייוודעו לפרויקטי מחקר בין-יחידתיים בטכניון, בדגש על פרויקטים בעלי רכיב כמותי משמעותי."
