            "סילבוס": "פרויקט המשך לקורס 066012 שיבשיל לביצוע ממשי. מטרת הפרויקט הקבוצתי לפתח מוצר חדש בתחום הביוטכנולוגיה או המזון משלב הרעיון ועד היישוםתוך שימוש הידע שרכשו בקורסי הבסיס. הצוותים יבצעו פרויקטים אינטגרטיביים שיכללו תיכנון המוצר, סקר ספרות, ניתוח כלכלי, ניתוח השוק, פילוח המתחרים, כתיבת תוכנית עסקית בסיסית. בסוף הפרויקט הסטודנטים יציגו את התוצר בפני מומחים מהתעשייה והאקדמיה. תוצאות למידה: בסיום הקורס, הסטודנט יהיה מסוגל: 1. להבין את האתגרים בפיתוח מוצר בתחום הביוטכ' והמזון. 2. לתכנן ולבצע ניסוי מדעי באופן עצמאי. 3. לנסח רעיונות ופתרונות בעזרת כלים חשיבתיים. 4. לפתח יכולת עבודה בצוות מקומי או בינלאומי ולפתח כישורי רשתות עסקיות. 5. להציג רעיון בצורה ממוקדת כמו גם סמינר באנגלית למומחים בתחום."
