            "סילבוס": "בשנה האקדמית האחרונה ללימודיו בוחר כל סטודנט בפרויקט תכן דו-סמסטריאלי. הפרויקט יהיה בתחום הנדסת אוירונוטיקה וחלל ויעסוק בנושאים הקשורים לכלי טייס ולוינים ומערכותיהם, מנועים רקטיים וסילוניים, מערכות שגור, מערכות תחזוקה תעופתיות, ונושאים אחרים, כפי שיוגדרו מדי פעם.לכל פרויקט יקבע מספר מזהה עם הגדרתו. הפרויקט יתבסס על סינטזה של ידע בתחומים שונים וידרוש עמידה במפרט קבוע מראש ובמעטפת בצועים נתונה. הפרויקט כולל תכן ראשוני עד להקפאת התכנון, שיבוצע בסמסטר הראשון. הסמסטר השני יוקדש לתכן מפורט של המערכת (או חלק ממנה). הפרויקט הגמור כולל מפרט, הצגת הפתרון, הצגת הביצועים, ביצוע ניסויים,יצור מודלים ודווח מפורט. הפרויקט יתבצע בפקולטה או בתעשיה. ההוראה בפרויקט מורכב ת מהרצאות ומעבודה עצמית בהנחית חבר סגל או מורה נספח. הסטודנט מודרך בארגון ובגבוש דרך פתרון, לוח זמנים, שקולי אלטרנטיבות, היקף, שמושבאמצעי עזר, קטלוגים ויעוץ, ודווח בכתב ובעל פה."
