            "סילבוס": "הקורס דורש ביצוע פרויקט ארגוני, כפרקטיקום בפסיכולוגיה. הפרויקט מקנה התנסות באיתור ופתרון בעיות של תהליכים ארגוניים וניהול המשאב האנושי. הפרויקט ילווה במנחה מהארגון ומנחה אקדמי. בסיום הפרקטיקום הסטודנט יכיר תהליכי ארגוניים ושיטות לטיפול במשאב האנושי, יכתוב דו\"ח מסכם של הבעיה, הפתרון ותהליך הלמידה לאור תיאוריות, שיטות וכלים מחקריים. \n תוצאות למידה: בסיום הקורס הסטודנט יהיה מסוגל:\n 1. להכיר תהליכים ארגוניים דרך עבודה מעשית בארגון. \n 2. לדעת לנתח תהליכים ניהוליים המשפיעים על המשאב האנושי לאור תאוריות ומתודות בארגונים.\n 3. לדעת לנתח קשרים בין מבנה ארגוני, תרבות ארגונית, פרקטיקות ניהוליות והתנהגות עובדים, תוך שימוש בכלים סטטיסטיים. \n 4. להבין את המורכבות האר גונית שמשפיעה על התנהגות מנהלים ועובדים והקשר להצלחת הארגון."
