            "סילבוס": "רגולציה של מכשור רפואי בארה\"ב, אירופה וישראל. הערכה של מסלול רגולטורי ודרישות תכן בהתאם לשימוש המיועד. מערכת איכות. ניתוח סיכונים. בקרת ציוד רפואי רשום. מחקרים קליניים בבני אדם. מבנה ותכנון פרוטוקול מחקר, לוגיסטיקה,דרישות מקדימות וחוקיות למחקר קליני, הגשה וקבלת אישור מוועדת האתיקה (הלסינקי). תוצאות למידה: בסיום הקורס, הסטודנט:\n 1.יכיר מושגים יסודיים ברגולציה ומחקר קליני.\n2. יכיר את הדרישות בנוגע לתיעוד של תהליכי פיתוח של מכשור רפואי. \n 3. יהיה מסוגל לתכנן ולכתוב פרוטוקול מחקר קליני בסיסי. 4. ידע להכין בקשה למחקר קליני לוועדת הלסינקי בארץ.\n 5. ידע לקבוע מהי הקלסיפיקציה המתאימה למכשיר רפואי נתון.\n6. ידע להעריך חלופות למסלול רגולטורי נדרש למכשיר רפואי חדש .\n 7. יוכל לבחון באופן ביקורתי ישימות ופוטנציאל הצלחה של מחקר קליני על בסיס פרוטוקול המחקר."
