            "סילבוס": "בקורס ילמדו כלים מרכזיים בביואינפורמטיקה, כולל דרכי גישה למאגרים של נתוני ענק בביולוגיה רפואה וגישות מתקדמות לניתוחם. יושם דגש על הכרה ושימוש של כלים קיימים בביואינפורמטיקה לפתרון בעיות בביולוגיה מולקולרית מודרנית. בקורס ילמדו דרכי ייצוג ואחזור רצפי חומצות גרעין וחלבונים מנתוני רצוף, ניבוי מבני של מולקולות ביולוגיות וניתוח רשתות ביולוגיות.\n תוצאות למידה: בסיום הקורס הסטודנטיות והסטודנטים יהיומסוגלים: \n 1. להבין את העקרונות הבסיסים של כלים הביואינפורמטיים בעלי שימוש נרחב. 2. להשתמש בשפת התכנות R  בכדי לענות של שאלות ביואינפורמטיות בסיסיות בתחום הביולוגיה והרפואה.\n 3. לנתח תוצאות ביואינפורמטיות בעזרת כלים סטטיסטיים מתאימים.\n 4. לאחזר דאטה ממאגריי נתונים ביואינפורמטיים לצורך ניתוחם.\n 5. לתכנן ולבצע פרויקט בסיסי בביואינפורמטיקה בעזרת הכלים שנלמדו ומאגרי הנתונים הקיימים.\n 6. לסכם תוצאות מחקר ביואינפומטי ולהציגו לקהל מקצועי."
