            "סילבוס": "הקורס מתמקד במעטפת המבנה! ושואף לצמצם את הפער הגדול בין האינטואיציה הרווחת בתכנון הצללה במבנים סביבנו! לבין הפוטנציאל הבלתי ממומש ליישום כלים ממוחשבים המאפשרים אנליזה סביבתית של ביצועי המעטפת בשלבים שונים בתהליך התכנון. הגישה שהקורס נוקט בה היא במחשבה בדיעבד )הנדסה הפוכה( כלומר הסטודנטים יתחילו מהתבוננות וניתוח הסביבה הבנויה על מנת לגבש תובנות תכנוניות ולהציע הצעות ייעול ושכלול. הקורס כולל שילוב בין הרצאות תיאורטיות! התנסות והתבוננות בשטח! ואנליזות ממוחשבות! במטרה )א(- לפתח יכולת להתבונן! לנתח ולהעריך את מידת האפקטיביות של אסטרטגיות תכנון מעטפת באמצעות כלים אנליטיים! ו)ב(- להשתמש במודל האנליטי על מנת לבחון אסטרטגיות ותרחישי תכנון מעטפת שונים בהתאם לתנא י הסביבה! דפוסי אכלוס המבנה ולאקלים ולמיקרו-האקלים.\nתוצאות למידה: בסיום הקורס הסטודנטיות והסטודנטים יהיו מסוגלים: \n 1. להכיר מדדים סביבתיים שונים וכן כלים שונים לחישוב יעיל שלהם עבור תפקוד מעטפת הבניין.\n 2. לבצע תעדוף של אפשרויות תכנון מעטפות בניין מתוך נקודת מוצא סביבתית רחבה.\n 3. לבצע אנליזות תפקודיות של מבנים קיימים בהתמקד במאפייני מעטפת הבניין שלהם.\n 4. להתנסות בניסוח יחסי הגומלין בין ההיבטים הסביבתיים והאנליזה החישובית שלהם! לבין ביטויים בתכנון האדריכלי בפרקטיקה."
